import Scard from "./Scard";
const SentRequests = () => {
  return (
    <div
      style={{
        margin: "auto",
        display: "flex",
        width: "100%",
        border: "1px solid red",
      }}
    >
      <Scard />
      <Scard />
      <Scard />
      <Scard />
      <Scard />
    </div>
  );
};

export default SentRequests;
